import React, { Component } from 'react'

export default class Userbeaches extends Component {
    render() {
        let userbeachesArr = this.props.userbeaches
        const userBeaches = userbeachesArr.map((userbeach) => {
            if (userbeach.user_id == this.props.user_id){
            return <span key={userbeach.favbeach_id}>
                {console.log("userbeach", userbeach.favbeach_id)}
                <div id="userbeach">
                    <div key={userbeach.favbeach_id}>
                    {userbeach.name}
                    </div>
                    <button id="userbeachesbuttons" onClick={()=>this.props.deleteFromUBs(userbeach)}>Delete from favorites.</button>
                    <button id="userbeachesbuttons" onClick={()=>this.props.reviewBeach(this.props, userbeach.id)}>Review this Beach</button> 
                </div>
            </span>}else{<span>This User Hasn't Chosen Any Favorite Yet.</span>}
        }
        )
        return (
            <div id="roundbutton">
                <button id="roundbutton"
                        onClick={()=>this.props.returnHome(this.props)}
                        >
                        Return to Beachfinder Main
                        </button>
            <div id="favbeachbox">Favorite Beaches:
                {userBeaches}
                <div id="userbeach">
                </div>
            </div>
            </div>
        )
    }
}
